import React from "react";
import "./ProductsOfArtist.css";

function ProductsOfArtist() {
  let products = [1, 2, 3, 4, 5, 6, 7, 8, 9];

  // make set of 3

  let pArr = [];
  products.forEach((element, i) => {
    console.log(i);
    if (i % 3 === 0) pArr.push([element]);
    else pArr[pArr.length - 1].push(element);
  });
  console.log(pArr);

  return (
    <div className="container-xxl">
      {pArr.map((el, i) => {
        return (
          <div className="row">
            {el.map((el2, i2) => {
              return (
                <div className="col mb-4">
                  <div class="gallery-item" tabindex="0">
                    <img
                      src={`https://images.unsplash.com/photo-1511765224389-37f0e77cf0eb?w=500&h=500&fit=crop`}
                      class="gallery-image"
                      alt=""
                    />

                    <div class="gallery-item-info">
                      <ul>
                        <li class="gallery-item-likes">
                          <span class="visually-hidden">Likes:</span>
                          <i class="fas fa-heart" aria-hidden="true"></i> 56
                        </li>
                      </ul>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        );
      })}
    </div>
  );
}

export default ProductsOfArtist;
